pragma solidity >=0.4.22 <0.6.0;

contract new_bond {
    address company_address;
    address sponsor;
    string public company_name;
    uint public send_time;
    string public start_time;
    string public end_time;
    uint public interest;
    bool public close = false;
    bool public ownerPay = false;
    uint public finishTime;
    modifier onlyOwner{
        require(msg.sender == company_address);
        _;
    }
    modifier notShutdown{
        require(close == false);
        _;
    }

    modifier shutdown{
        require(close == true);
        _;
    }
    modifier payInterest{
        require (ownerPay == true );
        _;
    }
    mapping(address=>detail) public ConsumerDetail;
    struct detail{
        uint buyTime;
        uint money;
        uint refund;
    }
    constructor(string memory companyName,string memory startTime,string memory endTime,
                    uint _interest) public {
        company_address = msg.sender;
        send_time = now;
        company_name = companyName;
        start_time = startTime;
        end_time = endTime;
        interest = _interest;
    }
    function buy(address _consumer,uint _money)public payable notShutdown{
        ConsumerDetail[_consumer] = detail({
            buyTime: now,
            money : _money,
            refund : _money * interest
        });
        sponsor = _consumer;
    }
    function end() onlyOwner public{
        close = true;
    }

    function ownerPayInterest()public onlyOwner shutdown payable
    {
        if(msg.value == ConsumerDetail[sponsor].money *1000000000000000000)
        {
            ownerPay =true;
        }
    }
    function make_payable(address x) internal pure returns(address payable){
        return address(uint160(x));
    }
    function sendRefund() public
     onlyOwner
     payInterest
     {
        make_payable(sponsor).transfer(address(this).balance);
        finishTime =now;

    }
}
